import ExpenseItem from "./components/ExpenseItem";
import './components/ExpenseItem.css'

function App() {
  var expenses = [
    {
      id:'e1',
      date: new Date(2022, 2, 25),
      title: 'Toilet Papers',
      amount: 1545.3
    },
    {
      id:'e2',
      date: new Date(2021, 3, 26),
      title: 'New TV',
      amount: 459.3
    },
    {
      id:'e3',
      date: new Date(2020, 4, 27),
      title: 'Car Insurance',
      amount: 779.86
    }
  ]

  return (
    <div>
      <ExpenseItem date = {expenses[0].date} title = {expenses[0].title} amount = {expenses[0].amount} />
      <ExpenseItem date = {expenses[1].date} title = {expenses[1].title} amount = {expenses[1].amount}/>
      <ExpenseItem title = {expenses[2].title} amount = {expenses[2].amount}/>
    </div>
  );
}

export default App;
